import React from "react";

interface Character {
  name: string;
}

interface CharModalProps {
  clickedChar: Character | null;
}

const CharModal: React.FC<CharModalProps> = ({ clickedChar }) => {
  return <div className="char-modal">{clickedChar?.name}</div>;
};

export default CharModal;
